@title RoleAdminable
 @notice See the documentation in {IRoleAdminable}.
 @dev This contract is a lightweight version of OpenZeppelin's AccessControl contract which can be found at
 https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v5.3.0/contracts/access/AccessControl.sol. The contract
 inherits from {Adminable} and extends it with role-based permissions where the admin can grant and revoke roles to
 other accounts. Both role holders and the admin can access functions protected by roles.

@title SablierComptroller
 @notice See the documentation in {ISablierComptroller}.
 @dev This contract inherits from OpenZeppelin's UUPS upgradeable contract and can perform an upgrade when used as an
 implementation of an {ERC1967Proxy}.

@dev We reserve 50 storage slots to allow for adding new state variables in this and its parent contracts in the
 future. A gap of 46 slots is added in addition to 1 slot used by admin in {Adminable}, 1 empty slot used by the
 roles mapping, 1 slot used by the oracle and 1 empty slot used by protocol fees mapping.

